// WorkerPage.js

import React, { useState } from 'react';
import logo from './logo.png'; // Import your logo image
import './WorkerPage.css'; // Import your CSS file for WorkerPage styles

const WorkerPage = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [employees, setEmployees] = useState([
    { id: 1, name: 'John Doe', dob: '1990-01-01', role: 'Developer' },
    { id: 2, name: 'Jane Smith', dob: '1985-05-15', role: 'Designer' },
    // Add more employee data as needed
  ]);

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const filteredEmployees = employees.filter(employee =>
    employee.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  return (
    <div className="worker-page-container">
      <img src={logo} alt="Logo" className="logo" />
      <h2>Worker Page</h2>
      <input 
        type="text" 
        placeholder="Search by name..." 
        value={searchQuery} 
        onChange={handleSearchChange} 
      />
      <div className="employee-list">
        {filteredEmployees.map(employee => (
          <div key={employee.id} className="employee-item">
            <p>Emp ID: {employee.id}</p>
            <p>Name: {employee.name}</p>
            <p>DOB: {employee.dob}</p>
            <p>Role: {employee.role}</p>
          </div>
        ))}
      </div>
      <img src="/worker_logo.png" alt="Worker Logo" className="worker-logo" />
    </div>
  );
}

export default WorkerPage;
